import React, { Component } from 'react';

export default class Three_ extends Component {

    render(){
        return(
            <tr class="table-secondary">
                <td>{this.props.name}</td> 
                <td>{this.props.wins}</td>
                <td>{this.props.losses}</td>
                <td>{this.props.draws}</td>
                <td>{this.props.pf}</td>
                <td>{this.props.pa}</td>
                <td>{this.props.pd}</td>
                <td>{this.props.bp}</td>
                <td>{this.props.tp}</td>
            </tr>
        )
    }



}
